import React from "react";

const Car = ({ car }) => {
  return (
    <tr>
      <td>{car.name}</td>
      <td>{car.model}</td>
      <td>{car.type}</td>
      <td><button className="btn btn-warning xs">Edit</button></td>
      <td><button className="btn btn-danger xs">Delete</button></td>
    </tr>
  );
};

export default Car;
